import React from "react";

export default function about() {
  return (
  <section id="about" className="about-section">
  <h2>About Me</h2>
  <p>
    I'm Sakshi Kadu, a Computer Science and Engineering student at YCCE, Nagpur, likely to graduate in 2027. I’m a tech-enthusiast with a strong passion for web development and a constant desire to learn and explore new technologies.
  </p>
  <p>
    I enjoy building responsive and interactive websites using modern tools like HTML, CSS, JavaScript, React, and Bootstrap. I’m also exploring animations using GSAP and version control with Git & GitHub.
  </p>
  <p>
    Besides development, I have a deep interest in problem-solving and improving my skills in data structures and algorithms. Solving logical challenges helps me think better and grow stronger as a developer.
  </p>
  <p>
    My goal is to become a skilled and confident full-stack web developer, capable of transforming creative ideas into real-world digital experiences.
  </p>
</section>

  );
}
